import time
def sortBySalary(a):
    return a[3]

def Calendar(hire,staff,n):
    money = 0
    for i in hire:
        for j in range(i[0],i[1]+1):
            if staff[j-1] > 0:
                if  staff[j-1] >= i[2]:
                    money += i[2]*i[3]
                    staff[j-1] -=i[2]
                else:
                    money += staff[j-1]*i[3]
                    staff[j-1] = 0    
    return money
           

    




def building(hire,n,k):
    hire = sorted(hire,key = sortBySalary)
    staff = [k for i in range(0,n)]

    money = Calendar(hire,staff,n)
    
    return money

